#!/usr/bin/env bash

set -e

DEFAULT_PREFIX=~/.local/bin
PAYLOAD_LINE=$(awk '/^__PAYLOAD_BEGINS__/ { print NR + 1; exit 0; }' $0)
TMPD=$(mktemp -d)
echo "Using temp dir ${TMPD}"
tail -n +${PAYLOAD_LINE} $0 | base64 -d | cat > ${TMPD}/ps1
chmod +x ${TMPD}/ps1

read -p "Install ps1 to ${DEFAULT_PREFIX}? [y/n]: " yn
case "$yn" in
  [Nn]*)
    read -p "Please enter desired path:" p
    export DEFAULT_PREFIX=${p}
    ;;
esac

mkdir -p ${DEFAULT_PREFIX}; cp ${TMPD}/ps1 ${DEFAULT_PREFIX};

read -p "Add ps1 to ~/.bashrc? [y/n]" yn
case "$yn" in
  [Yy]*)
    echo $(${DEFAULT_PREFIX}/ps1 -c) >> ~/.bashrc
    echo "Now source ~/.bashrc to enable ps1"
    ;;
  [Nn]*)
    echo "To enable ps1 in the future, either run:"
    echo -e "\t$ eval \$(ps1 -c)"
    echo 
    echo or to enable permanently:
    echo -e "\t$ echo \$(ps1 -c) >> ~/.bashrc && . ~/.bashrc"
    ;;
esac

exit 0

